import React from 'react';
import { useLocation } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import DashboardCard from './DashboardCard';
import ReportCard from './ReportCard';
import './maskgroup.css';
import PieChart from './PieChart';

const Maskgroup = () => {
  const location = useLocation();
  const { data, feature, sub_feature } = location.state;

  // Handle undefined data gracefully
  const pieChartData = data && data.total_score ? [data.total_score, 100 - data.total_score] : [0, 100];

  const numericalData = data && data.numerical_data ? data.numerical_data : {};
  const cardsData = [
    { title: 'Media Queries', value: numericalData.media_query_count || 0, percentage: '', className: 'maskgroup-dashboardcard1' },
    { title: 'Average Image Score', value: numericalData.average_image_score || 0, percentage: '', className: 'maskgroup-dashboardcard4' },
    { title: 'Lazy Count', value: numericalData.lazy_count || 0, percentage: '', className: 'maskgroup-dashboardcard5' },
    { title: 'Touch-friendly Count', value: numericalData.touch_friendly_count || 0, percentage: '', className: 'maskgroup-dashboardcard6' },
    { title: 'Flex Count', value: numericalData.flex_count || 0, percentage: '', className: 'maskgroup-dashboardcard7' },
    { title: 'Grid Count', value: numericalData.grid_count || 0, percentage: '', className: 'maskgroup-dashboardcard8' },
    { title: 'REM Count', value: numericalData.rem_count || 0, percentage: '', className: 'maskgroup-dashboardcard9' },
    { title: 'EM Count', value: numericalData.em_count || 0, percentage: '', className: 'maskgroup-dashboardcard10' },
  ];

  // Example reportsData (previous reports)
  const reportsData = [
    { date: '02 Feb 2023', title: 'Report 1', description: "Brainstorming brings team members' diverse experience into play.", className: 'maskgroup-card1' },
    { date: '02 Feb 2023', title: 'Report 2', description: "Brainstorming brings team members' diverse experience into play.", className: 'maskgroup-card2' },
  ];

  // One-liner information from report
  const oneLinerData = data && data.one_liner_data ? data.one_liner_data : [];

  return (
    <div className="maskgroup-container1">
      <Helmet>
        <title>Web Analyzer Report</title>
      </Helmet>
      <div className="maskgroup-maskgroup">
        <div className="maskgroup-dashbaord">
          {cardsData.map((card, index) => (
            <DashboardCard
              key={index}
              title={card.title}
              value={card.value}
              percentage={card.percentage}
              className={card.className}
            />
          ))}
          <div className="maskgroup-dashboardcard2">
            <div className="maskgroup-container2">
              <span className="maskgroup-text193">
                <span>Report Data</span>
              </span>
            </div>
            <div className="maskgroup-chart">
              <PieChart data={pieChartData} />
            </div>
          </div>
          <div className="maskgroup-dashboardcard3">
            <span className="maskgroup-text228">
              <span>One Liner Information</span>
            </span>
            <div className="maskgroup-frame427318883">
              {oneLinerData.map((line, index) => (
                <span key={index} className="maskgroup-text230">{line}</span>
              ))}
            </div>
          </div>
          <div className="maskgroup-block">
            <span className="maskgroup-text244">
              <span>Recent Reports</span>
            </span>
            {reportsData.map((report, index) => (
              <ReportCard
                key={index}
                date={report.date}
                title={report.title}
                description={report.description}
                className={report.className}
              />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Maskgroup;
